import React from 'react'
function go() {
    window.location = '/home'
}


class top extends React.Component {
    render() {
        return (
            <div>
                <h1>Hello!</h1> <br /> <h2>welcome to the secret world of PADAH (Professional Agency of Detectives And Hackers).
            <br /> You will be directed to your Home Page when you are finished reading.
            <br /> You will be able to Discover, Learn and Grow on this interactive site.
            <br /> Enjoy!!!</h2>

                <section className="button">
                    <a href="/home" class="animated-button1" onClick={go}>
                        <span></span>
                        <span></span>
                        <span></span>
                        <span></span>
                        Go to home
                </a>
                </section>
            </div>
        )
    }
}

export default top;
